import React from "react";

function Footer() {
  return (
    <div className="row py-3 justify-content-center">
      <a
        href="http://www.ghibli.jp/"
        target="_blank"
        rel="noopener noreferrer"
        className="text-dark"
      >
        Learn more about Studio Ghibli
      </a>
    </div>
  );
}

export default Footer;
